fn send_stage_constants(tx: &mpsc::Sender<Vec<u8>>) -> Result<(), mpsc::SendError<Vec<u8>>> {
    for (kind, name) in [
        (0,   "Battlefield"),
        (1,   "Final Destination"),  // BF Omega form
        (3,   "Final Destination"),
        (4,   "Battlefield"),  // FD battlefield form
        (5,   "Peach's Castle"),
        (44,  "Yoshi's Story"),
        (89,  "Lylat Cruise"),
        (95,  "Smashville"),
        (107, "Pokemon Stadium 2"),
        (242, "Kalos Pokemon League"),
        (257, "Town and City"),
        (347, "Small Battlefield"),
    ].iter() {
        let name_bytes = name.as_bytes();
        let [kind0, kind1] = (*kind as u16).to_be_bytes();
        let data = &[MessageType::StageKinds.into(), kind0, kind1, name_bytes.len() as u8];
        let data = &[data, name_bytes].concat();
        tx.send(data.to_vec())?;
    }
    Ok(())
}

